import { Box, Card, CardContent, CardMedia, Typography } from "@mui/material";
import { useEffect, useState } from "react";
import axios from 'axios';

export const Product = () => {
            const [data,setData]=useState()


        useEffect(() => {
            axios.get(`https://dummyjson.com/products`)

            .then((res)=>{
                console.log("data",res.data.products)
                setData(res.data.products)
            })

            .catch((err)=>{
                console.log("Err",err)
            })

        },[]);
        
    return (
        <>
            <Box sx={{ gap: "20px", display: "grid", width: "100vw", justifyContent: "space-around", marginTop: "100px", gridTemplateColumns: "auto auto auto" }}>

                <Card sx={{ maxWidth: 345 }}>
                <CardMedia
                        component="img"
                        height="140"
                        image="https://dummyjson.com/image/i/products/30/3.jpg"
                    />
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                            Keyring Holder
                        </Typography>
                        <Typography variant="body2" color="text.secondary">
                            NUMBERS RAKHNI HOOO
                        </Typography>
                    </CardContent>
                </Card>

            </Box>
        </>


    )
};
